-- ----------------------------
-- Table structure for ts_alarm
-- ----------------------------
DROP TABLE IF EXISTS `ts_alarm`;
CREATE TABLE `ts_alarm` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自动编号',
  `alarm_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '报警时间',
  `case_source` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '案件来源，dict_item表中主键',
  `alarm_name` varchar(255) NOT NULL DEFAULT '' COMMENT '报警人姓名',
  `contact` varchar(255) NOT NULL DEFAULT '' COMMENT '单位及联系方式',
  `is_protect` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否需要保密0否1是',
  `accident_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '事故发生时间',
  `accident_place` varchar(255) NOT NULL DEFAULT '' COMMENT '事故发生地点',
  `casualties` text COMMENT '人员伤亡情况',
  `remark` text COMMENT '备注',
  `scene_end_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '现场处置结束时间',
  `handle_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '处理方式\r\n0未处理，\r\n1当事人自行处理，\r\n2快处中心处理，\r\n3事故中队处理',
  `is_link` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否关联 关联事故编号',
  `case_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '关联的事故编号',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `create_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建用户编号',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新时间',
  `update_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新用户编号',
  `is_del` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否作废',
  `del_reason` text COMMENT '作废原因',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='报警';

