-- ----------------------------
-- Table structure for ts_case
-- ----------------------------
DROP TABLE IF EXISTS `ts_case`;
CREATE TABLE `ts_case` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自动编号',
  `code` varchar(255) NOT NULL DEFAULT '' COMMENT '案件编号',
  `num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '案件序号，每年、每部门一套',
  `cate` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '案件处理类型0普通处理1快速处理',
  `accident_name` varchar(255) NOT NULL DEFAULT '' COMMENT '事故名称',
  `accident_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '发生时间',
  `accident_place` varchar(255) NOT NULL DEFAULT '' COMMENT '事故发生地点',
  `lng` varchar(255) NOT NULL DEFAULT '' COMMENT '纬度',
  `lat` varchar(255) NOT NULL DEFAULT '' COMMENT '经度',
  `death_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '死亡人数',
  `hurt_num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '受伤人数',
  `property_loss` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '财产损失 字典',
  `accident_type` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '事故类型 字典',
  `first_cognizance` varchar(255) NOT NULL DEFAULT '' COMMENT '事故初查 字典  多个ID用半角逗号分隔',
  `department_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '部门编号',
  `accept_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '受案信息保存状态\r\n0没有任何受案信息记录\r\n1保存过至少一条受案信息\r\n',
  `accept_check_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '受案登记审核状态\r\n0未提交审核\r\n1已提交审批（待审核）\r\n2审批已通过\r\n3审批未通过',
  `survey_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '现场勘察信息状态',
  `client_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '当事人状态',
  `record_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '询问笔录状态',
  `checkup_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '检验鉴定状态\r\n0没有有效的检验鉴定\r\n1存在有效的检验鉴定（非作废的全是有效的）',
  `law_doc_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '其他法律文书状态',
  `cognizance_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '事故认定保存状态\r\n0未做过事故认定\r\n1做过事故认定（管理员退回更新0）',
  `cognizance_check_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '事故认定\r\n0未提交审核\r\n1已提交审核（待审核）\r\n2审核通过\r\n3审核拒绝\r\n4管理员退回\r\n5复核科退回\r\n6已制作',
  `cognizance_send_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '事故认定送达状态\r\n0未送达\r\n1送达完成\r\n管理员退回、复核科退回事故认定后更新为0\r\n',
  `punish_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '处罚保存状态\r\n0未保存\r\n1已保存',
  `punish_complete_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '处罚完成状态\r\n0未全部完成\r\n1已全部完成',
  `mediate_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '调解保存状态\r\n0未保存过调解\r\n1已保存\r\n',
  `mediate_complete_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '调解是否全部完成\r\n0未完成\r\n1全部已完成',
  `catalog_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '案件归档状态',
  `review_submit_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '复核状态\r\n0未提交复核申请\r\n1已提交复核申请\r\n',
  `review_accept_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '复核受理状态\r\n0等待受理\r\n1复核申请已受理\r\n2复核申请拒绝受理',
  `review_result_status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '复核结论\r\n0没有结果\r\n1维持原判 （终止也算）\r\n2重新再来',
  `agreement_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '协议书保存状态',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `create_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建用户编号',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新时间',
  `update_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新用户编号',
  `is_del` int(1) NOT NULL DEFAULT '0' COMMENT '是否作废\r\n0正常\r\n1作废\r\n只有管理员可作废',
  `del_reason` text COMMENT '作废缘由',
  `is_over` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否完结\r\n一般事故认定，点击制作按钮更新1\r\n简易事故认定，点击保存按钮更新1\r\n管理员退回事故认定，点击退回按钮时更新0\r\n复核结论撤销重新制作提请审批，审批人最后一步通过时更新0',
  `cognizance_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '事故认定类型\r\n0未做事故认定\r\n1简单事故认定 \r\n2普通事故认定\r\n最后一次有效的事故认定类型，案件保存界面，保存一般或者简易认定类型时更新',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='案件';

