-- ----------------------------
-- Table structure for ts_case_accept
-- ----------------------------
DROP TABLE IF EXISTS `ts_case_accept`;
CREATE TABLE `ts_case_accept` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自动编号',
  `case_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '案件编号',
  `reason` varchar(255) NOT NULL DEFAULT '' COMMENT '案由',
  `case_src` varchar(255) NOT NULL DEFAULT '' COMMENT '案件来源(由报警信息查询出字符串或者手写输入）',
  `alarm_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '报警时间',
