  `reporter_sex` varchar(255) NOT NULL DEFAULT '' COMMENT '报警人性别',
  `reporter_tel` varchar(255) NOT NULL DEFAULT '' COMMENT '报警人联系电话',
  `reporter_address` varchar(255) NOT NULL DEFAULT '' COMMENT '报警人住址或者单位',
  `reporter_note` varchar(255) NOT NULL DEFAULT '' COMMENT '报警人附注',
  `content` text COMMENT '报案内容',
  `officer_opinion` varchar(255) NOT NULL DEFAULT '' COMMENT '受案人意见',
