  `carry_name_1` varchar(255) NOT NULL DEFAULT '' COMMENT '送检人姓名',
  `carry_post_1` varchar(255) NOT NULL DEFAULT '' COMMENT '送检人职务',
  `carry_idno_1` varchar(255) NOT NULL DEFAULT '' COMMENT '送检人证件名称及号码',
  `carry_name_2` varchar(255) NOT NULL DEFAULT '' COMMENT '送检人姓名',
  `carry_post_2` varchar(255) NOT NULL DEFAULT '' COMMENT '送检人职务',
  `carry_idno_2` varchar(255) NOT NULL DEFAULT '' COMMENT '送检人证件名称及号码',
  `carry_address` varchar(255) NOT NULL DEFAULT '' COMMENT '送检人通讯地址',
  `carry_zip` varchar(255) NOT NULL DEFAULT '' COMMENT '送检人邮政编码',
  `carry_tel` varchar(255) NOT NULL DEFAULT '' COMMENT '送检人联系电话',
  `carry_fax` varchar(255) NOT NULL DEFAULT '' COMMENT '送检人传真号码',
  `case_name` varchar(255) NOT NULL DEFAULT '' COMMENT '案件名称',
  `case_code` varchar(255) NOT NULL DEFAULT '' COMMENT '案件编号',
  `target_client_id` int(10) NOT NULL DEFAULT '0' COMMENT '被鉴定人id(从case_client)表当中读取',
  `target_name` varchar(255) NOT NULL DEFAULT '' COMMENT '被鉴定人姓名',
  `target_sex` varchar(255) NOT NULL DEFAULT '' COMMENT '被鉴定人性别',
  `target_age` varchar(255) NOT NULL DEFAULT '' COMMENT '被鉴定人年龄',
  `target_tel` varchar(255) NOT NULL DEFAULT '' COMMENT '被鉴定人电话',
  `target_company` varchar(255) NOT NULL DEFAULT '' COMMENT '被鉴定人单位',
  `target_address` varchar(255) NOT NULL DEFAULT '' COMMENT '被鉴定人现住址',
  `summary` text COMMENT '简要案情',
  `old_result` text COMMENT '原鉴定情况',
  `checkup_doc` text COMMENT '送检材料',
  `remark` text COMMENT '委托鉴定单位的鉴定要求和诚信声明',
  `is_first` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否第一次委托 （用于区分是办案人委托还是支队检验中心委托，为1时实际有效，为0时存档记录）',
  `is_finish` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否完成',
  `is_submit` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否以提交（未提交的是草稿）',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '处理状态 0未接收待处理1已接收2已委托其他机构',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `create_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建用户编号',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新时间',
  `update_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新用户编号',
  `is_del` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除',
  `train` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '当前年份 当前大队 委托信息排序值 ',
  PRIMARY KEY (`id`),
  KEY `caseid` (`case_id`),
  KEY `casecheckupid` (`case_checkup_id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='案件 - 检验鉴定 - 委托';

