-- ----------------------------
-- Table structure for ts_case_checkup_review
-- ----------------------------
DROP TABLE IF EXISTS `ts_case_checkup_review`;
CREATE TABLE `ts_case_checkup_review` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自动编号',
  `case_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '案件编号',
  `case_checkup_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '案件检验鉴定编号',
  `cate` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '审核类型 \r\n0延期 \r\n1超期 \r\n2超期并延期 \r\n3重新申请检验鉴定',
  `from_userid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '提交用户的用户编号',
  `to_userid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '审核人的用户编号',
  `title` varchar(255) NOT NULL DEFAULT '' COMMENT '标题',
  `content` text COMMENT '报告内容',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '审核结果 0待审核 1审核通过 2审核拒绝',
  `delay_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '如果是延期申请，延期到什么时候',
  `checked_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '审核时间',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  `create_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建用户编号',
  `update_time` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新时间',
  `update_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后更新用户编号',
  `is_del` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='案件 - 检验鉴定 - 审核\r\n\r\n需要审批条件 \r\n1.系统时间和人员死亡时间、事故开始时间、人员逃逸抓获时间 -> 超期 （3个工作日）只要有一个超期就算超期\r\n2.约定完成时间 -> 延期 （20个自然日）\r\n\r\n审批方法\r\n四种可能，超期审核  延期审核  超期并延期审核\r\n重新检验鉴定提交申请时需要审批也在这里';

