DROP TABLE IF EXISTS `ts_case_review`;
CREATE TABLE `ts_case_review` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '自动编号',
  `case_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '案件编号',
  `case_code` varchar(255) NOT NULL DEFAULT '' COMMENT '案件编号',
  `department_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '所属大队',
  `handle_user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '办案人用户编号',
